import React, { Fragment } from 'react';
import './SelectProfession.css'
import Navbar from './Navbar';
import { useNavigate } from 'react-router-dom';

export default function SelectProfession() {
    const Navigate=useNavigate()
    const asCustomer=()=>{
        Navigate('/AsCustomer')
    }

    const asWoker=()=>{
        Navigate('AsWorker')
    }

    return (
        
        <Fragment>
            {/* <Navbar></Navbar> */}
            <main>
                <body>
                    <div class="container">
                        <div class="card">
                            <img src="image1.jpg" alt="Image 1"/>
                                <h2>Card 1</h2>
                                <p>This is the content for card 1.</p>
                                <button class="Join As Customer" onclick={asCustomer}>Select Card 1</button>
                        </div>
                        <div class="card">
                            <img src="image2.jpg" alt="Image 2"/>
                                <h2>Card 2</h2>
                                <p>This is the content for card 2.</p>
                                <button class="Join To Work" onclick={asWoker}>Select Card 2</button>
                        </div>
                    </div>
                   
                </body>

            </main>
        </Fragment>
    );
}
